import React from 'react';
import { View, Text, FormControl, Input, InputField} from '@gluestack-ui/themed';

const Register = () => {
    return <View>
        <FormControl
            isInvalid={false}
            size={"lg"}
            isDisabled={false}
            isRequired={true}
            w={"$4/5"}
            justifyContent="center"
            marginTop={"$5"}
          >
            <Input borderRadius="$2xl" borderWidth="$0" h={"$12"}>
              <InputField
                type="text"
                placeholder="Email"
                backgroundColor="white"
              />
            </Input>
          </FormControl>

          <FormControl
            isInvalid={false}
            size={"lg"}
            isDisabled={false}
            isRequired={true}
            w={"$4/5"}
            justifyContent="center"
            marginTop={"$5"}
          >
            <Input borderRadius="$2xl" borderWidth="$0" h={"$12"}>
              <InputField
                type="text"
                placeholder="Email"
                backgroundColor="white"
              />
            </Input>
          </FormControl>

          <FormControl
            isInvalid={false}
            size={"lg"}
            isDisabled={false}
            isRequired={true}
            w={"$4/5"}
            justifyContent="center"
            marginTop={"$5"}
          >
            <Input borderRadius="$2xl" borderWidth="$0" h={"$12"}>
              <InputField
                type="text"
                placeholder="Email"
                backgroundColor="white"
              />
            </Input>
          </FormControl>


    </View>
};

export default Register;
